import React from "react";
import Main from "./components/Main";
import Header from "./components/Header";
import Footer from "./components/footer";
let cars = [
  {
    model: "Mers",
    price: 560000,
    amout: 3,
  },

  {
    model: "Bmw",
    price: 7600000,
    amout: 2,
  },
  {
    model: "Priora",
    price: 1560000,
    amout: 1,
  },
  {
    model: "Camry",
    price: 5100000,
    amout: 19,
  },
  {
    model: "Zeekr001",
    price: 560000,
    amout: 10,
  },
];
function App() {
  let carsPrice = cars.filter((car) => {
    return car.price >= 550000;
  });
  let carsModel = carsPrice.map((car) => {
    return <p> car{car.price}</p>;
  });

  return (
    <>
      <div className="container number ">{carsModel}</div>
    </>
  );
}
export default App;
